import Image from "./Image";
import './imag'
function ImageList({ images }) {
	console.log(
		"------------------ImageList------------------",
		images
	);
	const imageElements = images.map((image) => {
		return <Image key={image.id} image={image} />;
	});
	return (
		<div
			className="images-list"
			style={
				{
					// display: "flex",
					// gap: "5px",
					// flexWrap: "wrap",
					// justifyContent: "center",
				}
			}
		>
			{imageElements}
		</div>
	);
}

export default ImageList;
